import React, { useState} from 'react';
import './App.css';
import {
  BrowserRouter as Router,Switch,Route, Link
} from "react-router-dom";
import {
  Carousel,
  CarouselItem,
  CarouselControl,
  CarouselIndicators,
  CarouselCaption,
  Button
} from 'reactstrap';

import Home from './Pages/Home';
import Jupiter from './Pages/Jupiter';
import Explore from './Pages/Explore';
import Discover from './Pages/Discover';
import Map from './Pages/Map';
import Pay from './Pages/Pay';
import trip from './reducers/trips';

import {Provider} from 'react-redux';

import {createStore, combineReducers}  from 'redux';
import {loadStripe} from '@stripe/stripe-js';


const stripePromise = loadStripe('pk_test_51HfQFACHHl93Y5PiikCQkm8axeZ7jnK9A00dlk15nvLMz29O2p2hU6mAhD0fBqAdnMukCTa5rIJlgiHHgAxBQLF200UoWuTYvv');

const store = createStore(combineReducers({trip}));


function App(){
  return (
    <Router>
      <div>
        <Switch>
        <Provider store={store}>
            <Route path="/explore" exact component={Explore} />
            <Route path="/map" exact component={Map} />
            <Route path="/jupiter" exact component={Jupiter}/>
            <Route path="/home" exact component={Home} />
            <Route path="/pay" exact component={Pay} />
            <Route path="/" exact component={Discover} />
          </Provider>
        </Switch>
        <Elements stripe={stripePromise}>
          <Pay/>
        </Elements>
      </div>
    </Router>
  );
}



export default App;
